import { BrowserRouter as Router } from "react-router-dom";
import React from "react";
import {
  Heading,
  Container,
  Card,
  CardBody,
  CharacterName,
  CardFooter,
  CardDetailsLink,
} from "./styles";

import Character from "./Character/Character";
const Characters = () => {
  return (
    <>
      <Heading>Star Wars Characters</Heading>
      <Container>
        <Character />
      </Container>
    </>
  );
};

export default Characters;
